import React from 'react'
import StoryCell from '../components/StoryCell'

export default ({ stories, toggleLike }) => {
  return (
    <div className='Stories'>
      {
        stories.map(story =>
          <StoryCell
            key={story.id}
            story={story}
            handleClick={() => toggleLike(story.id)}
          />
        )
      }
    </div>
  )
}
